import React from 'react';
import '../css/Home.css';
import '../css/Bootstrap.css';

class Home extends React.Component{
  renderPanels(buttonTitle){
    document.body.style = 'background: #40627d;';
    return(
      <div className="col-md panel">
        <button type="button" class="btn btn-primary btn-lg button">{buttonTitle}</button>
      </div>
    );
  }

  render(){
    return(
        <div className="container">
          <div className="page-header">
            <h2 className="title">Concussion Competencies</h2>
            <h5 className="title"> <small> A FRAMEWORK FOR SCHOOL-BASED CONCUSSION MANAGEMENT</small></h5>
          </div>
          <div className="row row align-items-center">
            {this.renderPanels('Learn More')}
            {this.renderPanels('Blog')}
            {this.renderPanels('Contact Us')}
          </div>
        </div>
    );
  };
}

export default Home;
